import React from "react";
import ReactDOM from "react-dom";

const name = "Kenan";
const img = "https://picsum.photos/200"



ReactDOM.render(
  <div>
  <h1 className = "heading" contentEditable = "true" spellCheck = "false">Created by {name}</h1>
<div>
  <img className = "dog-img" src="https://www.https://www.google.com/imgres?imgurl=https%3A%2F%2Fi.natgeofe.com%2Fn%2F4f5aaece-3300-41a4-b2a8-ed2708a0a27c%2Fdomestic-dog_thumb.jpg&imgrefurl=https%3A%2F%2Fwww.nationalgeographic.com%2Fanimals%2Fmammals%2Ffacts%2Fdomestic-dog&tbnid=jgAWGBAOBbiMrM&vet=12ahUKEwi19NHjuZbwAhUrMuwKHUS8AQEQMygLegUIARDnAQ..i&docid=VGirYKV8sLnrzM&w=3072&h=3072&q=dog&ved=2ahUKEwi19NHjuZbwAhUrMuwKHUS8AQEQMygLegUIARDnAQ.com/imgres?imgurl=https%3A%2F%2Fwww.sciencemag.org%2Fsites%2Fdefault%2Ffiles%2Fstyles%2Finline__450w__no_aspect%2Fpublic%2Fdogs_1280p_0.jpg%3Fitok%3Dh6VBayx-&imgrefurl=https%3A%2F%2Fwww.sciencemag.org%2Fnews%2F2019%2F11%2Fhere-s-better-way-convert-dog-years-human-years-scientists-say&tbnid=mgU42Jvqq0WTcM&vet=12ahUKEwi19NHjuZbwAhUrMuwKHUS8AQEQMygDegUIARDXAQ..i&docid=hIhaF-9jq0GbvM&w=450&h=253&q=dog&ved=2ahUKEwi19NHjuZbwAhUrMuwKHUS8AQEQMygDegUIARDXAQ"/>
